import AllBlogPosts from "../components/blogData.js/allBlogPosts";
import { Container, Jumbotron } from "react-bootstrap";

export default function Blog() {
  return (
    <div>
      <Container style={{ height: "700px" }}>
        <Jumbotron fluid>
          <h1 style={{ textAlign: "center" }}>Blog</h1>
        </Jumbotron>

        <AllBlogPosts />
      </Container>
    </div>
  );
}
